import { jsPDF } from "jspdf"
var font = '';
var callAddFont = function () {
this.addFileToVFS('NotoSansOriya-VariableFont_wdth,wght-normal.ttf', font);
this.addFont('NotoSansOriya-VariableFont_wdth,wght-normal.ttf', 'NotoSansOriya-VariableFont_wdth,wght', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
export default font;
